import React from 'react';
import Navbar from '../../components/Navbar/Navbar';
import content from "../../content.json";
const Dashboard = ()=>{
    console.log(content)
    const {Cards=[]} = content;
    return(
        <React.Fragment>
            {Cards && Cards.forEach((card)=>{
                return(
                    <div>
                        <h3>{card.name}</h3>
                        <img src={card.image}/>
                    </div>
                )

            })}
        </React.Fragment>
    )

};
export default Dashboard;
